	<body style="word-wrap: break-word; -webkit-nbsp-mode: space; -webkit-line-break: after-white-space; ">
		<div>
			<h1 style="border: 0px; margin: 0px 0px 10px; padding: 0px; font-size: 2.1em; color: rgb(0, 0, 0); text-decoration: none; text-indent: 0px; font-family: 'Helvetica Neue', Helvetica, 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Noto Sans CJK SC', 'WenQuanYi Micro Hei', Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Git 工作流程
			</h1>
			<p style="border: 0px; margin: 0px; padding: 0px; line-height: 2em; word-wrap: break-word; word-break: break-all; font-size: 13px; font-family: 'Helvetica Neue', Helvetica, 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Noto Sans CJK SC', 'WenQuanYi Micro Hei', Arial, sans-serif; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;">本章节我们将为大家介绍 Git 的工作流程。
			</p>
			<p style="border: 0px; margin: 0px; padding: 0px; line-height: 2em; word-wrap: break-word; word-break: break-all; font-size: 13px; font-family: 'Helvetica Neue', Helvetica, 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Noto Sans CJK SC', 'WenQuanYi Micro Hei', Arial, sans-serif; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;">一般工作流程如下：
			</p>
			<ul style="border: 0px; margin: 1em 0px; padding: 0px; line-height: 16.8px; list-style: none; color: rgb(51, 51, 51); font-family: 'Helvetica Neue', Helvetica, 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Noto Sans CJK SC', 'WenQuanYi Micro Hei', Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;">
				<li style="border: 0px; margin: 0px 0px 1em 1em; padding: 0px 0px 0px 1.5em; line-height: 1.5em; font-size: 13px; word-break: break-all; background-image: url('./assets/img/bullet.png'); background-repeat: no-repeat; background-position: left 0.5em;">克隆 Git 资源作为工作目录。
				</li>
				<li style="border: 0px; margin: 0px 0px 1em 1em; padding: 0px 0px 0px 1.5em; line-height: 1.5em; font-size: 13px; word-break: break-all; background-image: url('./assets/img/bullet.png'); background-repeat: no-repeat; background-position: left 0.5em;">在克隆的资源上添加或修改文件。
				</li>
				<li style="border: 0px; margin: 0px 0px 1em 1em; padding: 0px 0px 0px 1.5em; line-height: 1.5em; font-size: 13px; word-break: break-all; background-image: url('./assets/img/bullet.png'); background-repeat: no-repeat; background-position: left 0.5em;">如果其他人修改了，你可以更新资源。
				</li>
				<li style="border: 0px; margin: 0px 0px 1em 1em; padding: 0px 0px 0px 1.5em; line-height: 1.5em; font-size: 13px; word-break: break-all; background-image: url('./assets/img/bullet.png'); background-repeat: no-repeat; background-position: left 0.5em;">在提交前查看修改。
				</li>
				<li style="border: 0px; margin: 0px 0px 1em 1em; padding: 0px 0px 0px 1.5em; line-height: 1.5em; font-size: 13px; word-break: break-all; background-image: url('./assets/img/bullet.png'); background-repeat: no-repeat; background-position: left 0.5em;">提交修改。
				</li>
				<li style="border: 0px; margin: 0px 0px 1em 1em; padding: 0px 0px 0px 1.5em; line-height: 1.5em; font-size: 13px; word-break: break-all; background-image: url('./assets/img/bullet.png'); background-repeat: no-repeat; background-position: left 0.5em;">在修改完成后，如果发现错误，可以撤回提交并再次修改并提交。
				</li>
			</ul>
			<p style="border: 0px; margin: 0px; padding: 0px; line-height: 2em; word-wrap: break-word; word-break: break-all; font-size: 13px; font-family: 'Helvetica Neue', Helvetica, 'PingFang SC', 'Hiragino Sans GB', 'Microsoft YaHei', 'Noto Sans CJK SC', 'WenQuanYi Micro Hei', Arial, sans-serif; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;">下图展示了 Git 的工作流程：
